css:
.nuclide-vcs-log-spinner {
  margin-top: 2em;
  text-align: center;
}
.nuclide-vcs-log-scroll-container {
  height: 100%;
  overflow-y: scroll;
}
.nuclide-vcs-log-cell {
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  padding: 4px;
  vertical-align: top;
}
.nuclide-vcs-log-fixed-cell {
  white-space: nowrap;
}
.nuclide-vcs-log-header-cell {
  padding: 4px 6px;
}
.nuclide-vcs-log-date-cell {
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  padding: 4px;
  vertical-align: top;
  white-space: nowrap;
  color: #5293d8;
}
.nuclide-vcs-log-id-cell {
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  padding: 4px;
  vertical-align: top;
  white-space: nowrap;
  color: #45a815;
}
.nuclide-vcs-log-differential-cell {
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  padding: 4px;
  vertical-align: top;
  white-space: nowrap;
  color: #000000;
  text-decoration: underline;
}
.nuclide-vcs-log-differential-cell-text {
  cursor: pointer;
}
.nuclide-vcs-log-author-cell {
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  padding: 4px;
  vertical-align: top;
  white-space: nowrap;
}
.nuclide-vcs-log-summary-cell {
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  padding: 4px;
  vertical-align: top;
  color: #000000;
}
